/* harmony default export */ __webpack_exports__["default"] = ("<div class=\"row\" id=\"faq\">\n  <div class=\"col-xl-12\">\n    <div class=\"page-header\">\n      <h4 class=\"all-caps\">\n        <span class=\"fa-stack fa-md\">\n          <i class=\"fa fa-circle fa-stack-2x\"></i>\n          <i class=\"fa fa-question fa-stack-1x fa-inverse\"></i>\n        </span>\n        Frequently Asked Questions\n      </h4>\n    </div>\n    <!-- .page-header -->\n  </div>\n  <!-- .col-xl-12 -->\n\n  <div class=\"col-xl-12\">\n    <div class=\"card shadow\">\n      <div class=\"card-body\">\n        <div class=\"col-md-12\">\n\n          <div class=\"question-panel\">\n            <div class=\"question-container\">\n              <div class=\"question-section\">\n                <h5><span class=\"qa-label\">Q.</span>&nbsp;How do I fill-out my Official Receipt based on the\n                  disbursement statement?</h5>\n              </div>\n              <div class=\"clearfix\"></div>\n            </div>\n            <div class=\"answer-container\">\n              <div class=\"answer-section col-xs-11\">\n                <h5><span class=\"qa-label\">A.</span>&nbsp;&nbsp;Sample Disbursement Statement - TWB</h5>\n                <img src=\"./assets/images/faq/sample-ds.png\" alt=\"disbursement-statement TWB\" />\n                <br />\n                <br />\n                <h5>Sample Disbursement Statement - NIIS</h5>\n                <img src=\"./assets/images/faq/sample-cpr.png\" alt=\"disbursement-statement NIIS\" />\n                <br />\n                <br />\n                <h5>Sample BIR Official Receipt</h5>\n                <img src=\"./assets/images/faq/sample-or.png\" alt=\"disbursement-statement BIR-OR\" />\n              </div>\n              <div class=\"clearfix\"></div>\n            </div>\n          </div>\n\n          <div class=\"question-panel\">\n            <div class=\"question-container\">\n              <div class=\"question-section col-xs-11\">\n                <h5><span class=\"qa-label\">Q.</span>&nbsp;How would I know if my Official Receipt is valid?</h5>\n              </div>\n              <div class=\"clearfix\"></div>\n            </div>\n            <div class=\"answer-container\">\n              <div class=\"answer-section col-xs-11\">\n                <p><span class=\"qa-label\">A.</span>&nbsp;&nbsp;Validity period of Official Receipt is <strong>five (5)\n                    years</strong> only. e.g. If the Official\n                  Receipt is printed\n                  on July 12, 2019, Official Receipt is still acceptable until July 11, 2024.</p>\n              </div>\n              <div class=\"clearfix\"></div>\n            </div>\n          </div>\n\n          <div class=\"question-panel\">\n            <div class=\"question-container\">\n              <div class=\"question-section col-xs-11\">\n                <h5><span class=\"qa-label\">Q.</span>&nbsp;Where can I submit my Official Receipts?</h5>\n              </div>\n              <div class=\"clearfix\"></div>\n            </div>\n            <div class=\"answer-container\">\n              <div class=\"answer-section col-xs-11\">\n                <p><span class=\"qa-label\">A.</span>&nbsp;&nbsp;You may submit your Official Receipts to <strong>any\n                    MAPFRE Insurance Sales Office</strong> near you.\n                </p>\n              </div>\n              <div class=\"clearfix\"></div>\n            </div>\n          </div>\n\n          <div class=\"question-panel\">\n            <div class=\"question-container\">\n              <div class=\"question-section col-xs-11\">\n                <h5><span class=\"qa-label\">Q.</span>&nbsp;What are the cut-offs and schedules I need to remember?</h5>\n              </div>\n              <div class=\"clearfix\"></div>\n            </div>\n            <div class=\"answer-container\">\n              <div class=\"answer-section col-xs-11\">\n                <span class=\"qa-label\">A.</span>\n                <ol>\n                  <li>All Official Receipts in exchange of commission received from previous month shall be\n                    submitted to Head Office c/o Commission personnel on or before 1st Monday of the following month.\n                  </li>\n                  <li>In the event that Official Receipt was not submitted during the 1st week, agent should\n                    submit the pending Official Receipt before Monday of the following week.</li>\n                  <li>Transfer of Commission to agent's ATM account is every Wednesday and Thursday</li>\n                  <li>Disbursement Statement will be sent to agent's registered email every Wednesday and Friday\n                    by senders noreply@mapfreinsurance.com.ph; treasuryho@mapfreinsurance.com.ph</li>\n                  <li>Commission to be released is based on the premiums posted as fully paid in the system from\n                    Tuesday (prior week) up to Monday (current week).</li>\n                </ol>\n              </div>\n              <div class=\"clearfix\"></div>\n            </div>\n          </div>\n\n          <div class=\"question-panel\">\n            <div class=\"question-container\">\n              <div class=\"question-section col-xs-11\">\n                <h5><span class=\"qa-label\">Q.</span>&nbsp;How will I be able to receive my commissions for my paid\n                  accounts?</h5>\n              </div>\n              <div class=\"clearfix\"></div>\n            </div>\n            <div class=\"answer-container\">\n              <div class=\"answer-section col-xs-11\">\n                <p><span class=\"qa-label\">A.</span>&nbsp;&nbsp;Commissions for licensed individuals shall only be paid\n                  via transfer to their registered BPI account\n                  number.</p>\n              </div>\n              <div class=\"clearfix\"></div>\n            </div>\n          </div>\n\n          <div class=\"question-panel\">\n            <div class=\"question-container\">\n              <div class=\"question-section col-xs-11\">\n                <h5><span class=\"qa-label\">Q.</span>&nbsp;What if I don't have BPI account? Are there other banks\n                  available?</h5>\n              </div>\n              <div class=\"clearfix\"></div>\n            </div>\n            <div class=\"answer-container\">\n              <div class=\"answer-section col-xs-11\">\n                <p><span class=\"qa-label\">A.</span>&nbsp;&nbsp;<strong>None</strong>, but MAPFRE can endorse you to open\n                  a BPI account without maintaining balance\n                  provided you have regular\n                  commission being credited to your account. If after six months and no amount has been credited, the\n                  bank\n                  shall\n                  change it to regular account with required ADB. Other terms and conditions are indicated in the BPI\n                  endorsement form.</p>\n              </div>\n              <div class=\"clearfix\"></div>\n            </div>\n          </div>\n\n          <div class=\"question-panel\">\n            <div class=\"question-container\">\n              <div class=\"question-section col-xs-11\">\n                <h5><span class=\"qa-label\">Q.</span>&nbsp;If I have existing BPI account, can I use it?</h5>\n              </div>\n              <div class=\"clearfix\"></div>\n            </div>\n            <div class=\"answer-container\">\n              <div class=\"answer-section col-xs-11\">\n                <p><span class=\"qa-label\">A.</span>&nbsp;&nbsp;<strong>Yes</strong>, all BPI accounts (current or\n                  savings) except for BPI Family Savings</p>\n              </div>\n              <div class=\"clearfix\"></div>\n            </div>\n          </div>\n\n          <div class=\"question-panel\">\n            <div class=\"question-container\">\n              <div class=\"question-section col-xs-11\">\n                <h5><span class=\"qa-label\">Q.</span>&nbsp;What are the requirements in order to receive my commissions\n                  regularly?</h5>\n              </div>\n              <div class=\"clearfix\"></div>\n            </div>\n            <div class=\"answer-container\">\n              <div class=\"answer-section col-xs-11\">\n                <p><span class=\"qa-label\">A.</span>&nbsp;&nbsp;Aside from having a valid license and duly submitted MOA\n                  (Memorandum of Agreement), you must submit\n                  your\n                  <strong>valid BIR Official Receipts (OR)</strong> on or before the due date which is indicated in the\n                  email advice sent by\n                  MAPFRE to your registered email address. Youmay issue Official Receipt based on the statement\n                  received\n                  weekly\n                  or for the total amount received in a month provided that issue date is within the month commission\n                  was\n                  released. Ensure that you sign the OR on the space provided for signature every time you issue the OR.\n                </p>\n              </div>\n              <div class=\"clearfix\"></div>\n            </div>\n          </div>\n\n          <div class=\"question-panel\">\n            <div class=\"question-container\">\n              <div class=\"question-section col-xs-11\">\n                <h5><span class=\"qa-label\">Q.</span>&nbsp;Where can I send my queries or concerns with regards to my\n                  commission?</h5>\n              </div>\n              <div class=\"clearfix\"></div>\n            </div>\n            <div class=\"answer-container\">\n              <div class=\"answer-section col-xs-11\">\n                <p><span class=\"qa-label\">A.</span>&nbsp;&nbsp;You may email your concerns or queries to\n                  <strong>DCU@mapfreinsurance.com.ph</strong>\n                  or <strong>mrbdagsa@mapfreinsurance.com.ph</strong></p>\n              </div>\n              <div class=\"clearfix\"></div>\n            </div>\n          </div>\n\n          <div class=\"question-panel\">\n            <div class=\"question-container\">\n              <div class=\"question-section col-xs-11\">\n                <h5><span class=\"qa-label\">Q.</span>&nbsp;What are the possible causes of a negative amount reflected on\n                  my disbursement statement</h5>\n              </div>\n              <div class=\"clearfix\"></div>\n            </div>\n            <div class=\"answer-container\">\n              <div class=\"answer-section col-xs-11\">\n                <p><span class=\"qa-label\">A.</span>&nbsp;&nbsp;Aside from the the deductions found in the column\n                  <strong>advance disbursement</strong>, which\n                  represent the\n                  discounts/commission given to clients by the agent. There will be a negative effect on your\n                  commission if there is:</p>\n                <ul>\n                  <li>returned check/bounced check</li>\n                  <li>cancellation endorsement</li>\n                </ul>\n              </div>\n              <div class=\"clearfix\"></div>\n            </div>\n          </div>\n\n        </div>\n        <!-- .col-md-12 -->\n      </div>\n      <!-- .card-body -->\n    </div>\n    <!-- .card.shadow -->\n  </div>\n  <!-- .col-xl-12 -->\n</div>\n<!-- #faq -->\n");

